import React, { useLayoutEffect } from "react";

//import social 
import {social} from '../data'

const Socials = () => {
    return (
        <ul className="flex space-x-6 ">
            {social.map((item, index)=>{
                return <li 
                className="flex justify-center items-center text-accent "
                key={index}>
                    <a  href={item.href}></a>
                </li>
            })}
        </ul>
    )
}

export default Socials
